INSERT INTO `newsmanagement` VALUES ('402881e74423c050014423d46ed10001', '402881f73eb1d487013eb1ed69470011', '李克强：统一城乡居民养老保险 增强全社会安全感', '新华网北京2月7日电（李苑）国务院总理李克强今日主持召开国务院常务会议，听取关于2013年全国人大代表建议和全国政协委员提案办理工作汇报，决定合并新型农村社会养老保险和城镇居民社会养老保险，建立全国统一的城乡居民基本养老保险制度。', '<p>当前，我国存在地区发展不均衡、城乡差距仍然较大的实际问题，不仅困扰着经济与整个社会的和谐发展，也成为阻碍城镇化进程的关键因素。</p><p>&nbsp;&nbsp;&nbsp;&nbsp; \r\n国家统计局公开数据显示，目前我国城镇和农村居民的收入水平保持3倍左右的差距。社科院近期发布的《社会蓝皮书》显示，2012年，我国城镇居民社会养老\r\n保险和新型农村社会养老保险的参保率分别呈上升趋势，其中，城镇职工人均养老金水平已达2.09万元，新农保为859.15元，两者相差24倍之多。</p><p>&nbsp;&nbsp;&nbsp;&nbsp; \r\n社会保障必须向农村倾斜，才能照顾到更多困难群众，并使全体人民公平享有基本养老保障。近年来，尽管各级政府在完善农村社保方面付出了持续而有效的努力，\r\n譬如建立健全了新型农村合作医疗、新型农村养老保险和农村低保等，但实际上保险覆盖面狭窄、保障水平较低等难题依然没有得到根本解决。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;针对这个难题，此次国务院常务会议提出，在已基本实现新型农村社会养老保险、城镇居民社会养老保险全覆盖的基础上，依法将这两项制度合并实\r\n施，在全国范围内建立统一的城乡居民基本养老保险制度，并在制度模式、筹资方式、待遇支付等方面与合并前的新型农村社会养老保险和城镇居民社会养老保险保\r\n持基本一致。</p><p><br/></p>', '1', '402881f73e1c4ba4013e1c4c08470001', '2014-02-12 10:02:08', '2014-02-12 10:02:08', '26', '4', '0', null, '0');
INSERT INTO `newsmanagement` VALUES ('402881e74423efaa0144241747680006', '402881f73eb1d487013eb1ed69470011', '习近平向俄媒表达中国改革决心', null, '<p>&nbsp; &nbsp; 参考消息2月10日报道【俄新社俄罗斯布拉戈维申斯克2月8日电】中国国家主席<span name=\"HL_TAG\" style=\"border-bottom:dotted 0px;color:#0084D8;text-decoration:underline;cursor:hand\">习近平</span>在接受俄罗斯电视台“星期六新闻”节目主持人谢尔盖•布里廖夫专访时表示，中国容易的、皆大欢喜的改革已经完成，现在该啃“硬骨头”了。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;<span name=\"HL_TAG\" style=\"border-bottom:dotted 0px;color:#0084D8;text-decoration:underline;cursor:hand\">中国</span>国家主席承诺会继续推进改革开放进程，同时指出改革已进入艰难时期。他说，中国改革“已进入深水区，可以说，容易的、皆大欢喜的改革已经完成了，好吃的肉都吃掉了，剩下的都是难啃的硬骨头……改革再难也要向前推进”，“要把改革推向前进，必须加强顶层设计”。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;习近平提到了中国在经济、政治、社会、文化和生态文明等领域的<span name=\"HL_TAG\" style=\"border-bottom:dotted 0px;color:#0084D8;text-decoration:underline;cursor:hand\">改革</span>方针。他说：“我们成立了中央全面深化改革领导小组，由我本人担任组长，任务就是统一部署和协调一些重大问题。”他强调，改革中的任何事情都要“一分部署，九分落实”，“胆子要大、步子要稳”，“方向一定要准……不能犯颠覆性错误”。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;【俄塔社<span name=\"HL_TAG\" style=\"border-bottom:dotted 0px;color:#0084D8;text-decoration:underline;cursor:hand\">俄罗斯</span>符拉迪沃斯托克2月8日电】中国国家主席习近平在接受俄罗斯电视台采访时表示，俄罗斯和中国的政治信任水平高，如今正在将政治优势化为合作优势。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;习近平指出：“我对中俄关系发展取得的成果十分满意。当前中俄关系发展是基础最牢、互信最高、地区和国际影响最大的一个时期。”他说，他和普京总统“一致决定，要确保中俄关系继续在高水平发展，加大相互政治支持，深入推进务实合作”。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;习近平还表示，中国北京市联合张家口市已经向国际奥委会正式提出申办2022年<span name=\"HL_TAG\" style=\"border-bottom:dotted 0px;color:#0084D8;text-decoration:underline;cursor:hand\">冬奥会</span>，北京希望借鉴俄罗斯筹办冬奥会的经验。</p><p><br/></p>', '1', '402881f73e1c4ba4013e1c4c08470001', '2014-02-12 11:15:09', '2014-02-12 11:15:55', '6', '0', '0', '402881f73e1c4ba4013e1c4c08470001', '0');
INSERT INTO `newsmanagement` VALUES ('402881ea3f8d968e013f8da0bda50002', '402881f73eb1d487013eb1ed69470011', '朴槿惠今天在清华演讲 韩官员称因系习近平母校', '朴槿惠访华', '<p>&nbsp;昨天，国家主席习近平在北京钓鱼台国宾馆会见韩国总统朴槿惠。&nbsp;&nbsp;新华社发<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;正在中国访问的韩国总统朴槿惠昨天出席中韩商务合作论坛并发表开幕演讲。朴槿惠在演讲接近尾声时，以字正腔圆的中文引用中国俗语称：&ldquo;先做朋友，后做生意。&rdquo;她表示，这句话很好地折射出韩中两国关系的过去和现在。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;一起走，才走得远<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;昨天，由中国贸促会与韩国大韩商工会议所共同主办的&ldquo;中韩商务合作论坛&rdquo;在北京钓鱼台国宾馆举行。朴槿惠出席并发表演讲。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&ldquo;有句话说，要走得快，就一个人走；要走得远，就要一起走。&rdquo;朴槿惠说，若两国能够携手共进，两国的未来将更加明朗，更加繁荣。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;朴槿惠表示，自1992年建交后20多年来，韩中两国不断扩大交流与合作。中韩建交当初，两国贸易额仅为63亿美元，而2012年增加至2563亿美元，增长了40倍。中国成为韩国最大贸易伙伴，而韩国也成为中国的第三大贸易伙伴。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;她 表示，若说过去20年的两国经济合作靠贸易和投资，那么今后20年需要靠高附加值产业。目前，韩中两国致力于从国民的创新能力寻找新的机会，中国政府正基 于自主创新的精神培育新兴产业，韩国政府也以创新能力为基础，推动产业与文化相融合的创造经济。若两国政府在这领域的努力发展成为相互合作，必将取得巨大 的协同效应。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;有制度，才能持续<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&ldquo;没有人，什么都没法实现；但没有制度，什么都无法持续。&rdquo;朴槿惠表示，随着中韩两国经济日益扩大，为持续取得良好成果，两国需要为此提供坚固的制度框架。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&ldquo;我 相信，韩中自贸协定将成为我们所需的基础。&rdquo;朴槿惠说，韩中自贸协定将是在多边经济体制下最成功的两个国家签署的协定，我们要拿出成为国际模范的全新合作 模式。两国首脑已对韩中自贸协定的重要性达成共识，并决定为了该协定的签署而共同努力。希望在座的两国经济界人士为了韩中两国自贸协定能够成功签署，凝聚 大家智慧，成为可靠的支持者。<br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;有信任，才有友谊</p>', '1', '402881f73e1c4ba4013e1c4c08470001', '2013-06-29 09:51:29', '2013-11-12 11:08:12', '309', '9', '0', '402881f73e1c4ba4013e1c4c08470001', '1');
