INSERT INTO `rg_rulesregulations` VALUES ('40282c814235287301423552ea55000a', '402881e63f3b23a2013f3b55913e001b', '<p>第5条 公司招用员工实行男女平等、民族平等原则，特殊工种或岗位对性别、年龄等情形有特别规定的从其规定。</p>\r\n\r\n<p>第6条 公司招用员工实行全面考核、择优录用、任人唯贤、先内部选用后对外招聘的原则，不招用不符合录用条件的员工。</p>\r\n\r\n<p>第7条 员工应聘公司职位时，一般应当年满18周岁，身体健康，符合岗位录用条件。</p>\r\n\r\n<p>第8条 员工应聘公司职位时，必须是与其他用人单位合法解除或终止了劳动关系，必须如实正确填写《员工登记表》，不得填写任何虚假内容。</p>\r\n\r\n<p>第9条 员工应聘时提供的身份证、毕业证等证件必须是本人的真实证件，不得借用或伪造证件欺骗公司。</p>\r\n\r\n<p>公司录用员工，不收取员工的押金(转载自百分网http://www.oh100.com，请保留此标记物)，不扣留员工的身份证、毕业证等证件。</p>\r\n\r\n<p>第10条 公司十分重视员工的培训和教育，根据员工素质和岗位要求，实行职前培训、职业教育或在岗深造培训教育，培养员工的职业自豪感和职业道德意识。</p>\r\n\r\n<p>第11条 公司用于员工职业技能培训费用的支付和员工违约时培训费用的赔偿问题由劳动合同另行约定。</p>\r\n\r\n<p>第12条 公司对新录用的员工实行试用期制度，根据劳动合同期限的长短，试用期为1至6个月：合同期限三个月以上不满一年的，试用期不超过一个月;合同期限满一年不满三年的，试用期不超过二个月;合同期限满三年以上的，试用期不超过六个月。试用期包括在劳动合同期限中，并算作本公司的工作年限。</p>\r\n\r\n<p><br />\r\n&nbsp;</p>', '402881f73e1c4ba4013e1c4c08470001', '2013-11-08 09:28:15', '2013-11-08 09:30:32', '员工招用与培训教育', '402881f73e1c4ba4013e1c4c08470001');
INSERT INTO `rg_rulesregulations` VALUES ('40282c814235287301423554f4aa000b', '402881f741e7ebd00141e7fd501f0005', '<p>第一条公司司机必须遵守《<a class=\"inner-link decor-none\" href=\"http://zhidao.baidu.com/search?word=%E4%B8%AD%E5%8D%8E%E4%BA%BA%E6%B0%91%E5%85%B1%E5%92%8C%E5%9B%BD%E9%81%93%E8%B7%AF%E4%BA%A4%E9%80%9A%E7%AE%A1%E7%90%86%E6%9D%A1%E4%BE%8B&amp;fr=qb_search_exp&amp;ie=utf8\" rel=\"nofollow\" target=\"_blank\">中华人民共和国道路交通管理条例</a>》及有关交通安全管理的规章规则，安全驾车。并应遵守本公司其他相关的规章制度。<br />\r\n第二条司机应爱惜公司车辆，平时要注意车辆的保养，经常检查车辆的主要机件。每月至少用半天时间对自己所开车辆进行检修，确保车辆正确行驶。<br />\r\n第三条司机应每天抽适当时间擦洗自己所开车辆，以保持车辆的清洁(包括车内、车外和引擎的清洁)。<br />\r\n第四条出车前，要例行检查车辆的水、电、油及其他性能是否正常，发现不正常时，要立即加补或调整。出车回来，要检查存油量，发现存油不足一格时，应立即加油，不得出车时才临时去加油。<br />\r\n第五条司机发现所驾车辆有故障时要立即检修。不能检修的，应立即报告管理人员，并提出具体的维修意见(包括维修项目和大致需要的经费等)。未经批准，不许私自将车辆送厂维修。<br />\r\n第六条出车在外或出车归来停放车辆，一定要注意选择停放地点和位置，不能在不准停车的路段或危险地段停车。司机离开车时，要销好保险锁，防止车辆被盗。<br />\r\n第七条司机对自己所开车辆的各种证件的有效性应经常检查，出车时一定保证证件齐全。<br />\r\n第八条晚间司机要注意休息，不准疲劳开车，不准酒后驾车。<br />\r\n第九条司机驾车一定要遵守交通规则，文明开车，不准危险驾车(包括高速、爬坡、紧跟、争道、赛车等。)<br />\r\n第十条司机因故意违章或证件不全被罚款的，费用不予报销。违章造成后果由当事人负责。<br />\r\n第十一条车内不准吸烟 。本公司员工在车内吸烟时，应有礼貌地制止；公司外的客人在车内吸烟时，可婉转告知本公司陪同人，但不能直接制止。<br />\r\n<a class=\"inner-link decor-none\" href=\"http://zhidao.baidu.com/search?word=%E7%AD%BE%E5%8F%91%E4%BA%BA&amp;fr=qb_search_exp&amp;ie=utf8\" rel=\"nofollow\" target=\"_blank\">签发人</a> 责任人签名<br />\r\n制度名司机管理规定<br />\r\n电子文件编码GLZD232页码2-2<br />\r\n第十二条司机对乘车人要热情、礼貌，说话应文明。车内客人谈话时，除非客人主动搭话，不准随便插嘴。<br />\r\n第十三条接送员工上下班的司机，要准时出车，不得误点。<br />\r\n第十四条上班时间内司机未被派出车的，应随时在司机室等候出车，不准随便乱窜其他办公室。有要事确需离开司机室时，要告知管理人员去向和所需时间，经批准后方可离开；出车外出回来，应立即到管理人员处报到。<br />\r\n第十五条司机对管理人员的工作安排，应无条件服从，不准借故拖延或拒不出车。对工作安排有意见的，事后可向总办主任反映。<br />\r\n第十六条司机出车执行任务，遇特殊情况不能按时返回的，应及时设法通知管理人员，并说明原因。<br />\r\n第十七条不论什么时间，司机身上必须带传呼机。对公司领导或管理人员的传呼，应尽快回复。情况特殊确实不能回复的，事后一定要说明原因。<br />\r\n第十八条下班后，应将车辆停放适当地点保管，不准私自用车。<br />\r\n第十九条司机未经领导批准，不得将自己保管的车辆随便交给他人驾驶或练习驾驶；严禁将车辆交给无证人驾驶；任何人不得利用公司车辆学开车。<br />\r\n第二十条司机全年安全行车，未出交通事故的，给予奖励500元。<br />\r\n第二十一条总办每月负责对司机进行考核，将考核等级作为每月发放<a class=\"inner-link decor-none\" href=\"http://zhidao.baidu.com/search?word=%E6%B5%AE%E5%8A%A8%E5%B7%A5%E8%B5%84&amp;fr=qb_search_exp&amp;ie=utf8\" rel=\"nofollow\" target=\"_blank\">浮动工资</a>的依据。对于工作勤奋、遵守制度、表现突出的，可视具体情况给予嘉奖、记功、晋级等奖励；对工作怠慢、违反制度、发生事故者，视具体情节给予警告、记过、降级直至除名处理。</p>', '402881f73e1c4ba4013e1c4c08470001', '2013-11-08 09:30:29', '2013-11-12 11:10:57', '公司司机管理制度', '402881f73e1c4ba4013e1c4c08470001');
INSERT INTO `rm_rulesmanager` VALUES ('40282c81423528730142355734b9000c', '中华人民共和国全民所有制工业企业法', '402881e63f3b23a2013f3b55d19a001d', '402881f73e1c4ba4013e1c4c08470001', '402881f73e1c4ba4013e1c4c08470001', '2013-11-08 09:32:56', '2013-11-08 09:33:02', '<p>第一章　总　则</p>\r\n\r\n<p>　　第一条　为保障全民所有制经济的巩固和发展，明确全民所有制工业企业的权利和义务，保障其合法权益，增强其活力，促进社会主义现代化建设，根据《中华人民共和国宪法》，制定本法。</p>\r\n\r\n<p>　　第二条　全民所有制工业企业（以下简称企业）是依法自主经营、自负盈亏、独立核算的社会主义商品生产和经营单位。</p>\r\n\r\n<p>　　企业的财产属于全民所有，国家依照<a href=\"http://wuquan.lawtime.cn/syq/\" target=\"_blank\">所有权</a>和经营权分离的原则授予企业经营管理。企业对国家授予其经营管理的财产享有<a href=\"http://wuquan.lawtime.cn/zhanyou/\" target=\"_blank\">占有</a>、使用和依法处分的权利。</p>\r\n\r\n<p>　　企业依法取得<a href=\"http://www.lawtime.cn/info/minfa/faren/\" target=\"_blank\">法人</a>资格，以国家授予其经营管理的财产承担<a href=\"http://www.lawtime.cn/info/minfa/mszeren/\" target=\"_blank\">民事责任</a>。</p>\r\n\r\n<p>　　企业根据政府主管部门的决定，可以采取承包、<a href=\"http://www.lawtime.cn/info/gongsi/yunzuo/zulin/\" target=\"_blank\">租赁</a>等经营责任制形式。</p>\r\n\r\n<p>　　第三条　企业的根本任务是：根据国家计划和市场需求，发展商品生产，创造财富，增加积累，满足社会日益增长的物质和文化生活需要。</p>\r\n\r\n<p>　　第四条　企业必须坚持在建设社会主义物质文明的同时，建设社会主义精神文明，建设有理想、有道德、有文化、有纪律的职工队伍。</p>\r\n\r\n<p>　　第五条　企业必须遵守法律、法规，坚持社会主义方向。</p>\r\n\r\n<p>　　第六条　企业必须有效地利用国家授予其经营管理的财产，实现资产增殖；依法缴纳税金、费用、利润。</p>\r\n\r\n<p>　　第七条　企业实行厂长（经理）负责制。</p>\r\n\r\n<p>　　厂长依法行使职权，受法律保护。</p>');
INSERT INTO `rm_rulesmanager` VALUES ('40282c814235287301423558fe1f000e', '中华人民共和国宪法', '402881e63f3b23a2013f3b55d19a001d', '402881f73e1c4ba4013e1c4c08470001', '402881f73e1c4ba4013e1c4c08470001', '2013-11-08 09:34:53', '2013-12-09 16:03:36', '<div class=\"para\">《中华人民共和国宪法》是中华人民共和国的根本大法，<a href=\"/view/60883.htm\" target=\"_blank\">规定</a>拥有最高法律效力。中华人民共和国成立后，曾于1954年9月20日、1975年1月17日、1978年3月5日和1982年12月4日通过四个宪法，现行宪法为1982年宪法，并历经1993年、1999年、2004年三次修订。</div>\r\n\r\n<div class=\"para\">&nbsp;</div>\r\n\r\n<div class=\"para\">&nbsp;\r\n<h2>1<a name=\"1\"></a><a name=\"sub9353_1\"></a>修订历史</h2>\r\n\r\n<div class=\"para\"><a href=\"/view/1256.htm\" target=\"_blank\">中华人民共和国</a>成立前夕召开的中国<a href=\"/view/2193.htm\" target=\"_blank\">人民</a>政治协商会议的第一届全体会议通过的《中国人民政治协商会议共同<a href=\"/view/352062.htm\" target=\"_blank\">纲领</a>》于1949年9月29日颁布，具有临时<a href=\"/view/3575.htm\" target=\"_blank\">宪法</a>的作用。随后起草制定的中华人民共和国宪法历经四部，均以相应的年号作为区别。一般默认的宪法为最新版本，即八二宪法的2004年修正版。</div>\r\n\r\n<h3><a name=\"1_1\"></a><a name=\"sub9353_1_1\"></a>共同纲领</h3>\r\n\r\n<div class=\"para\">\r\n<div class=\"hierarchy-view log-set-param\">主词条: <a class=\"nslog:7301\" href=\"/view/428031.htm\" target=\"_blank\">中国人民政治协商会议共同纲领</a></div>\r\n\r\n<div class=\"clear\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"para\">1949年9月29日，<a href=\"/view/244325.htm\" target=\"_blank\">中国人民政治协商会议第一届全体会议</a>选举了中央人民政府委员会，宣告了<a href=\"/view/1256.htm\" target=\"_blank\">中华人民共和国</a>的成立，并且通过了起临时宪法作用的《<a href=\"/view/428031.htm\" target=\"_blank\">中国人民政治协商会议共同纲领</a>》。1949年颁布的《中国人民政治协商会议共同纲领》，虽不是真正意义上的宪法，却为宪法的订立奠定了基础。</div>\r\n\r\n<h3><a name=\"1_2\"></a><a name=\"sub9353_1_2\"></a>五四宪法</h3>\r\n\r\n<div class=\"para\">\r\n<div class=\"hierarchy-view log-set-param\">主词条: <a class=\"nslog:7301\" href=\"/view/1326562.htm\" target=\"_blank\">五四宪法</a></div>\r\n\r\n<div class=\"clear\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"para\">第一部《中华人民共和国宪法》于1954年9月20日在第一届全国人民代表大会第一次会议上通过，共4章106条。被称为<a href=\"/view/1326562.htm\" target=\"_blank\">五四宪法</a>。五四宪法是一部较为完善的宪法。<sup>[1]</sup><a name=\"ref_[1]_9353\"></a>这是中华人民共和国的第一部宪法，是在对建国前夕由全国政协制定的起临时宪法作用的《<a href=\"/view/319203.htm\" target=\"_blank\">共同纲领</a>》进行修改的基础上制定的。</div>\r\n\r\n<h3><a name=\"1_3\"></a><a name=\"sub9353_1_3\"></a>七五宪法</h3>\r\n\r\n<div class=\"para\">\r\n<div class=\"hierarchy-view log-set-param\">主词条: <a class=\"nslog:7301\" href=\"/view/4039754.htm\" target=\"_blank\">七五宪法</a></div>\r\n\r\n<div class=\"clear\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"para\">是一部有严重缺点、错误的宪法（可参阅<a href=\"/view/1921.htm\" target=\"_blank\">文化大革命</a>）。第二部《中华人民共和国宪法》于1975年1月17日在第四届全国人民代表大会第一次会议上通过，共30条，被称为<a href=\"/view/4039754.htm\" target=\"_blank\">七五宪法</a>。<sup>[2]</sup><a name=\"ref_[2]_9353\"></a>当时仍处于<a href=\"/view/1921.htm\" target=\"_blank\">文化大革命</a>时期，所以带有比较浓重的文革色彩。</div>\r\n\r\n<h3><a name=\"1_4\"></a><a name=\"sub9353_1_4\"></a>七八宪法</h3>\r\n\r\n<div class=\"para\">\r\n<div class=\"hierarchy-view log-set-param\">主词条: <a class=\"nslog:7301\" href=\"/view/6798323.htm\" target=\"_blank\">七八宪法</a></div>\r\n\r\n<div class=\"clear\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"para\">第三部《中华人民共和国宪法》于1978年3月5日在第五届全国人民代表大会第一次会议上通过，共4章60条。被称为<a href=\"/view/6798323.htm\" target=\"_blank\">七八宪法</a>。<sup>[3]</sup><a name=\"ref_[3]_9353\"></a></div>\r\n\r\n<h3><a name=\"1_5\"></a><a name=\"sub9353_1_5\"></a>八二宪法</h3>\r\n\r\n<div class=\"para\">\r\n<div class=\"hierarchy-view log-set-param\">主词条: <a class=\"nslog:7301\" href=\"/view/9716986.htm\" target=\"_blank\">八二宪法</a></div>\r\n\r\n<div class=\"clear\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"para\">我国当前现行现行宪法。\r\n<div class=\"text_pic layoutright\" style=\"width: 152px; padding-left: 20px;\"><a class=\"nslog:1199\" href=\"/picview/9353/9353/0/b3ba5d160f0b8e1920a4e9da.html\" style=\"width: 152px; height: 220px; display: block; position: relative;\" target=\"_blank\"><img alt=\"中华人民共和国八二宪法\" class=\"editorImg log-set-param\" src=\"http://c.hiphotos.baidu.com/baike/s%3D220/sign=c6268aa8fbedab6470724ac2c736af81/1c950a7b02087bf468f8a38af2d3572c11dfcfb9.jpg\" style=\"height:220px; width:152px\" title=\"中华人民共和国八二宪法\" /></a>\r\n\r\n<p><a class=\"nslog:1200 pic-handle\" href=\"/picview/9353/9353/0/b3ba5d160f0b8e1920a4e9da.html\" target=\"_blank\" title=\"查看图片\">&nbsp;&nbsp;</a>中华人民共和国八二宪法</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"para\">1982年12月4日，中华人民共和国第四部宪法在第五届全国人大第五次会议上正式通过并颁布。<sup>[4]</sup><a name=\"ref_[4]_9353\"></a>并根据1988年4月12日第七届全国人民代表大会第一次会议通过的《<a href=\"/view/27787.htm\" target=\"_blank\">中华人民共和国宪法修正案</a>》<sup>[5]</sup><a name=\"ref_[5]_9353\"></a>、1993年3月29日第八届全国<a href=\"/view/1324974.htm\" target=\"_blank\">人民代表</a><a href=\"/view/939676.htm\" target=\"_blank\">大会</a>第一次会议通过的《<a href=\"/view/27787.htm\" target=\"_blank\">中华人民共和国宪法修正案</a>》<sup>[6]</sup><a name=\"ref_[6]_9353\"></a>、1999年3月15日第九届全国人民代表大会第二次会议通过的《中华人民共和国宪法修正案》<sup>[7]</sup><a name=\"ref_[7]_9353\"></a>和2004年3月14日第十届全国人民代表大会第二次会议通过的《中华人民共和国宪法修正案》进行了修正。<sup>[8]</sup><a name=\"ref_[8]_9353\"></a></div>\r\n\r\n<h2>2<a name=\"2\"></a><a name=\"sub9353_2\"></a>现行宪法的审议历程</h2>\r\n\r\n<div class=\"para\">\r\n<div class=\"text_pic layoutright\" style=\"width: 220px; padding-left: 20px;\"><a class=\"nslog:1199\" href=\"/picview/9353/9353/0/d56b3634ca2642685ab5f536.html\" style=\"width: 220px; height: 167px; display: block; position: relative;\" target=\"_blank\"><img alt=\"毛泽东主席参与第一部宪法起草\" class=\"editorImg log-set-param\" src=\"http://g.hiphotos.baidu.com/baike/s%3D220/sign=c8c79be74aed2e73f8e9812eb700a16d/08f790529822720ef24e96997bcb0a46f31fabd5.jpg\" style=\"height:167px; width:220px\" title=\"毛泽东主席参与第一部宪法起草\" /></a>\r\n\r\n<p><a class=\"nslog:1200 pic-handle\" href=\"/picview/9353/9353/0/d56b3634ca2642685ab5f536.html\" target=\"_blank\" title=\"查看图片\">&nbsp;&nbsp;</a>毛泽东主席参与第一部宪法起草</p>\r\n</div>\r\n1982年12月4日第五届全国人民代表大会第五次会议通过。1982年12月4日全国人民代表大会公告公布施行</div>\r\n\r\n<div class=\"para\">根据1988年4月12日第七届全国人民代表大会第一次会议通过的《中华人民共和国宪法修正案》、1993年3月29日第八届全国人民代表大会第一次会议通过的《中华人民共和国宪法修正案》、1999年3月15日第九届全国人民代表大会第二次会议通过的《中华人民共和国宪法修正案》和2004年3月14日第十届全国人民代表大会第二次会议通过的《中华人民共和国宪法修正案》修正。</div>\r\n\r\n<h2>3<a name=\"3\"></a><a name=\"sub9353_3\"></a>现行宪法的内容</h2>\r\n\r\n<div class=\"para\">（1982年12月4日第五届全国人民代表大会第五次会议通过　1982年12月4日全国人民代表大会公告公布施行</div>\r\n\r\n<div class=\"para\">根据1988年4月12日第七届全国人民代表大会第一次会议通过的《中华人民共和国宪法修正案》、1993年3月29日第八届全国人民代表大会第一次会议通过的《中华人民共和国宪法修正案》、1999年3月15日第九届全国人民代表大会第二次会议通过的《中华人民共和国宪法修正案》和2004年3月14日第十届全国人民代表大会第二次会议通过的《中华人民共和国宪法修正案》修正）</div>\r\n\r\n<h3><a name=\"3_1\"></a><a name=\"sub9353_3_1\"></a>序言</h3>\r\n\r\n<div class=\"para\"><a href=\"/view/61891.htm\" target=\"_blank\">中国</a>是世界上<a href=\"/view/8081.htm\" target=\"_blank\">历史</a>最悠久的<a href=\"/view/8426.htm\" target=\"_blank\">国家</a>之一。中国各族人民共同创造了光辉灿烂的文化，具有光荣的革命传统。</div>\r\n\r\n<div class=\"para\">一八四〇年以后，封建的中国逐渐变成<a href=\"/view/40529.htm\" target=\"_blank\">半殖民地</a>、<a href=\"/view/71937.htm\" target=\"_blank\">半封建</a>的国家。中国人民为国家独立、民族解放和民主自由进行了前仆后继的英勇奋斗。</div>\r\n\r\n<div class=\"para\">二十世纪，中国发生了翻天覆地的伟大历史变革。</div>\r\n\r\n<div class=\"para\">一九一一年<a href=\"/view/2559.htm\" target=\"_blank\">孙中山</a>先生领导的<a href=\"/view/28947.htm\" target=\"_blank\">辛亥革命</a>，废除了封建帝制，创立了<a href=\"/view/22114.htm\" target=\"_blank\">中华民国</a>。但是，中国人民反对<a href=\"/view/60983.htm\" target=\"_blank\">帝国主义</a>和封建主义的历史任务还没有完成。</div>\r\n\r\n<div class=\"para\">一九四九年，以<a href=\"/view/1689.htm\" target=\"_blank\">毛泽东</a>主席为领袖的<a href=\"/view/1893.htm\" target=\"_blank\">中国共产党</a>领导中国各族人民，在经历了长期的艰难曲折的<a href=\"/view/270554.htm\" target=\"_blank\">武装斗争</a>和其他形式的斗争以后，终于推翻了帝国主义、封建主义和<a href=\"/view/783140.htm\" target=\"_blank\">官僚资本主义</a>的统治，取得了新民主主义革命的伟大胜利，建立了中华人民共和国。从此，中国人民掌握了国家的权力，成为国家的主人。</div>\r\n\r\n<div class=\"para\"><a href=\"/view/1256.htm\" target=\"_blank\">中华人民共和国</a>成立以后，我国社会逐步实现了由新民主主义到社会主义的过渡。<a href=\"/view/139835.htm\" target=\"_blank\">生产资料</a>公有制的社会主义改造已经完成，人剥削人的制度已经消灭，社会主义制度已经确立。<a href=\"/view/400954.htm\" target=\"_blank\">工人阶级</a>领导的、以工农联盟为基础的人民民主专政，实质上即<a href=\"/view/55501.htm\" target=\"_blank\">无产阶级专政</a>，得到巩固和发展。中国人民和<a href=\"/view/24050.htm\" target=\"_blank\">中国人民解放军</a>战胜了帝国主义、<a href=\"/view/8049.htm\" target=\"_blank\">霸权主义</a>的侵略、破坏和武装挑衅，维护了国家的独立和安全，增强了国防。经济建设取得了重大的成就，独立的、比较完整的社会主义工业体系已经基本形成，农业生产显著提高。教育、科学、文化等事业有了很大的发展，社会主义思想教育取得了明显的成效。广大人民的生活有了较大的改善。</div>\r\n\r\n<div class=\"para\">中国<a href=\"/view/32458.htm\" target=\"_blank\">新民主主义革命</a>的胜利和社会主义事业的成就，是中国共产党领导中国各族人民，在马克思列宁主义、毛泽东思想的指引下，坚持真理，修正错误，战胜许多艰难险阻而取得的。我国将长期处于社会主义初级阶段。国家的根本任务是，沿着<a href=\"/view/51025.htm\" target=\"_blank\">中国特色社会主义</a>道路，集中力量进行社会主义现代化建设。中国各族人民将继续在中国共产党领导下，在<a href=\"/view/505566.htm\" target=\"_blank\">马克思列宁主义</a>、<a href=\"/view/19940.htm\" target=\"_blank\">毛泽东思想</a>、<a href=\"/view/81772.htm\" target=\"_blank\">邓小平理论</a>、&ldquo;三个代表&rdquo;重要思想<sup>[9]</sup><a name=\"ref_[9]_9353\"></a>指引下，坚持<a href=\"/view/55518.htm\" target=\"_blank\">人民民主专政</a>，坚持<a href=\"/view/8059.htm\" target=\"_blank\">社会主义</a>道路，坚持<a href=\"/view/48598.htm\" target=\"_blank\">改革开放</a>，不断完善社会主义的各项制度，发展<a href=\"/view/31553.htm\" target=\"_blank\">社会主义市场经济</a>，发展<a href=\"/view/123483.htm\" target=\"_blank\">社会主义民主</a>，健全<a href=\"/view/308807.htm\" target=\"_blank\">社会主义法制</a>，自力更生，艰苦奋斗，逐步实现<a href=\"/view/10102.htm\" target=\"_blank\">工业</a>、<a href=\"/view/16684.htm\" target=\"_blank\">农业</a>、<a href=\"/view/88679.htm\" target=\"_blank\">国防</a>和<a href=\"/view/185129.htm\" target=\"_blank\">科学技术</a>的<a href=\"/view/124658.htm\" target=\"_blank\">现代化</a>，推动<a href=\"/view/203715.htm\" target=\"_blank\">物质文明</a>、<a href=\"/view/60010.htm\" target=\"_blank\">政治文明</a>和<a href=\"/view/203713.htm\" target=\"_blank\">精神文明</a>协调发展，把我国建设成为富强、民主、文明、和谐的社会主义国家。</div>\r\n\r\n<div class=\"para\">在我国，<a href=\"/view/465935.htm\" target=\"_blank\">剥削阶级</a>作为<a href=\"/view/8832.htm\" target=\"_blank\">阶级</a>已经消灭，但是<a href=\"/view/443931.htm\" target=\"_blank\">阶级斗争</a>还将在一定范围内长期存在。中国人民对敌视和破坏我国<a href=\"/view/1721645.htm\" target=\"_blank\">社会主义制度</a>的国内外的敌对势力和敌对分子，必须进行斗争。</div>\r\n\r\n<div class=\"para\"><a href=\"/view/2200.htm\" target=\"_blank\">台湾</a>是中华人民共和国的神圣领土的一部分。完成统一<a href=\"/view/63027.htm\" target=\"_blank\">祖国</a>的大业是包括<a href=\"/view/1710098.htm\" target=\"_blank\">台湾同胞</a>在内的全中国人民的神圣职责。</div>\r\n\r\n<div class=\"para\">社会主义的建设事业必须依靠<a href=\"/view/290319.htm\" target=\"_blank\">工人</a>、<a href=\"/view/24915.htm\" target=\"_blank\">农民</a>和<a href=\"/view/22129.htm\" target=\"_blank\">知识分子</a>，团结一切可以团结的力量。在长期的革命和建设过程中，已经结成由中国共产党领导的，有各<a href=\"/view/1913.htm\" target=\"_blank\">民主党派</a>和各<a href=\"/view/161693.htm\" target=\"_blank\">人民团体</a>参加的，包括全体社会主义<a href=\"/view/1253713.htm\" target=\"_blank\">劳动者</a>、社会主义事业的建设者、拥护社会主义的爱国者和拥护祖国统一的爱国者的广泛的爱国<a href=\"/view/55453.htm\" target=\"_blank\">统一战线</a>，这个统一战线将继续巩固和发展。<a href=\"/view/24083.htm\" target=\"_blank\">中国人民政治协商会议</a>是有广泛代表性的统一战线组织，过去发挥了重要的历史作用，今后在国家政治生活、社会生活和对外友好活动中，在进行社会主义现代化建设、维护国家的统一和团结的斗争中，将进一步发挥它的重要作用。<a href=\"/view/67557.htm\" target=\"_blank\">中国共产党领导的多党合作和政治协商制度</a>将长期存在和发展。</div>\r\n\r\n<div class=\"para\">中华人民共和国是全国各族<a href=\"/view/2193.htm\" target=\"_blank\">人民</a>共同缔造的统一的多民族国家。平等、团结、互助、和谐的<a href=\"/view/956068.htm\" target=\"_blank\">社会主义民族关系</a>已经确立，并将继续加强。在维护民族团结的斗争中，要反对<a href=\"/view/900.htm\" target=\"_blank\">大民族主义</a>，主要是<a href=\"/view/304454.htm\" target=\"_blank\">大汉族主义</a>，也要反对<a href=\"/view/144685.htm\" target=\"_blank\">地方民族主义</a>。国家尽一切努力，促进全国各民族的共同繁荣。</div>\r\n\r\n<div class=\"para\">中国革命和建设的成就是同<a href=\"/view/8083.htm\" target=\"_blank\">世界</a>人民的支持分不开的。中国的<a href=\"/view/636867.htm\" target=\"_blank\">前途</a>是同世界的前途紧密地联系在一起的。中国坚持独立自主的对外政策，坚持互相尊重<a href=\"/view/110482.htm\" target=\"_blank\">主权</a>和领土完整、互不侵犯、<a href=\"/view/1847680.htm\" target=\"_blank\">互不干涉内政</a>、平等互利、和平共处的五项原则，发展同各国的外交关系和经济、文化的交流；坚持反对帝国主义、霸权主义、殖民主义，加强同世界各国人民的团结，支持被压迫民族和发展中国家争取和维护民族独立、发展<a href=\"/view/125275.htm\" target=\"_blank\">民族经济</a>的正义斗争，为维护世界和平和促进人类进步事业而努力。</div>\r\n\r\n<div class=\"para\">本宪法以法律的形式确认了中国各族人民奋斗的成果，规定了国家的根本制度和根本任务，是国家的<a href=\"/view/16444.htm\" target=\"_blank\">根本法</a>，具有最高的法律效力。全国各族人民、一切国家机关和武装力量、各政党和各<a href=\"/view/1914.htm\" target=\"_blank\">社会团体</a>、各企业事业组织，都必须以宪法为根本的活动准则，并且负有维护宪法<a href=\"/view/54178.htm\" target=\"_blank\">尊严</a>、保证宪法实施的职责。</div>\r\n\r\n<h3><a name=\"3_2\"></a><a name=\"sub9353_3_2\"></a>第一章　总纲</h3>\r\n\r\n<div class=\"para\"><strong>第一条</strong>　中华人民共和国是<a href=\"/view/400954.htm\" target=\"_blank\">工人阶级</a>领导的、以<a href=\"/view/55477.htm\" target=\"_blank\">工农联盟</a>为基础的人民民主专政的<a href=\"/view/21409.htm\" target=\"_blank\">社会主义国家</a>。</div>\r\n\r\n<div class=\"para\">社会主义制度是中华人民共和国的根本制度。禁止任何组织或者个人破坏社会主义制度。</div>\r\n\r\n<div class=\"para\"><strong>第二条</strong>　中华人民共和国的一切权力属于人民。</div>\r\n\r\n<div class=\"para\">人民行使<a href=\"/view/257318.htm\" target=\"_blank\">国家权力</a>的机关是全国人民代表大会和地方各级人民代表大会。</div>\r\n\r\n<div class=\"para\">人民依照法律规定，通过各种途径和形式，管理国家事务，管理经济和文化事业，管理社会事务。</div>\r\n\r\n<div class=\"para\"><strong>第三条　</strong>中华人民共和国的国家机构实行<a href=\"/view/59981.htm\" target=\"_blank\">民主集中制</a>的原则。</div>\r\n\r\n<div class=\"para\">全国人民代表大会和地方各级人民代表大会都由<a href=\"/view/1960841.htm\" target=\"_blank\">民主选举</a>产生，对人民负责，受人民监督。</div>\r\n\r\n<div class=\"para\">国家<a href=\"/view/35736.htm\" target=\"_blank\">行政机关</a>、<a href=\"/view/1659990.htm\" target=\"_blank\">审判机关</a>、<a href=\"/view/263332.htm\" target=\"_blank\">检察机关</a>都由人民代表大会产生，对它负责，受它监督。</div>\r\n\r\n<div class=\"para\">中央和地方的国家机构职权的划分，遵循在中央的统一领导下，充分发挥地方的主动性、积极性的原则。</div>\r\n\r\n<div class=\"para\"><strong>第四条</strong>　中华人民共和国各民族一律平等。国家保障各<a href=\"/view/1917.htm\" target=\"_blank\">少数民族</a>的合法的权利和利益，维护和发展各民族的平等、团结、互助关系。禁止对任何民族的歧视和压迫，禁止破坏民族团结和制造<a href=\"/view/2985493.htm\" target=\"_blank\">民族分裂</a>的行为。</div>\r\n\r\n<div class=\"para\">国家根据各少数民族的特点和需要，帮助各少数民族地区加速经济和文化的发展。</div>\r\n\r\n<div class=\"para\">各少数民族聚居的地方实行区域自治，设立<a href=\"/view/2227882.htm\" target=\"_blank\">自治机关</a>，行使自治权。各<a href=\"/view/635354.htm\" target=\"_blank\">民族自治地方</a>都是中华人民共和国不可分离的部分。</div>\r\n\r\n<div class=\"para\">各民族都有使用和发展自己的语言文字的自由，都有保持或者改革自己的风俗习惯的自由。</div>\r\n\r\n<div class=\"para\"><strong>第五条</strong>　中华人民共和国实行<a href=\"/view/50940.htm\" target=\"_blank\">依法治国</a>，建设社会主义<a href=\"/view/1670084.htm\" target=\"_blank\">法治国家</a>。</div>\r\n\r\n<div class=\"para\">国家维护社会主义法制的统一和尊严。</div>\r\n\r\n<div class=\"para\">一切法律、<a href=\"/view/14951.htm\" target=\"_blank\">行政法规</a>和地方性法规都不得同宪法相抵触。</div>\r\n\r\n<div class=\"para\">一切国家机关和武装力量、各政党和各社会团体、各企业事业组织都必须遵守宪法和法律。一切违反宪法和法律的行为，必须予以追究。</div>\r\n\r\n<div class=\"para\">任何组织或者个人都不得有超越宪法和法律的特权。</div>\r\n\r\n<div class=\"para\"><strong>第六条</strong>　 中华人民共和国的社会主义经济制度的基础是生产资料的社会主义公有制，即全民所有制和劳动群众集体所有制。社会主义公有制消灭人剥削人的制度，实行各尽所能、按劳分配的原则。</div>\r\n\r\n<div class=\"para\">国家在社会主义初级阶段，坚持公有制为主体、多种所有制经济共同发展的基本经济制度，坚持按劳分配为主体、多种分配方式并存的分配制度。</div>\r\n\r\n<div class=\"para\"><strong>第七条</strong>　国有经济，即社会主义<a href=\"/view/278969.htm\" target=\"_blank\">全民所有制经济</a>，是国民经济中的主导力量。国家保障国有经济的巩固和发展。</div>\r\n\r\n<div class=\"para\"><strong>第八条</strong>　<a href=\"/view/3134539.htm\" target=\"_blank\">农村集体经济</a>组织实行<a href=\"/view/811095.htm\" target=\"_blank\">家庭承包经营</a>为基础、统分结合的<a href=\"/view/3533266.htm\" target=\"_blank\">双层经营体制</a>。农村中的生产、供销、信用、消费等各种形式的合作经济，是社会主义劳动群众集体所有制经济。参加农村集体经济组织的劳动者，有权在法律规定的范围内经营自留地、自留山、家庭副业和饲养自留畜。</div>\r\n\r\n<div class=\"para\">城镇中的<a href=\"/view/429288.htm\" target=\"_blank\">手工业</a>、<a href=\"/view/10102.htm\" target=\"_blank\">工业</a>、<a href=\"/view/728178.htm\" target=\"_blank\">建筑业</a>、<a href=\"/view/1034840.htm\" target=\"_blank\">运输业</a>、<a href=\"/view/8211.htm\" target=\"_blank\">商业</a>、<a href=\"/view/154003.htm\" target=\"_blank\">服务业</a>等行业的各种形式的<a href=\"/view/429036.htm\" target=\"_blank\">合作经济</a>，都是社会主义劳动群众集体所有制经济。</div>\r\n\r\n<div class=\"para\">国家保护城乡集体经济组织的合法的权利和利益，鼓励、指导和帮助集体经济的发展。</div>\r\n\r\n<div class=\"para\"><strong>第九条</strong>　矿藏、水流、森林、山岭、草原、荒地、滩涂等自然资源，都属于<a href=\"/view/2273638.htm\" target=\"_blank\">国家所有</a>，即全民所有；由法律规定属于集体所有的森林和山岭、草原、荒地、滩涂除外。</div>\r\n\r\n<div class=\"para\">国家保障自然资源的合理利用，保护珍贵的动物和植物。禁止任何组织或者个人用任何手段侵占或者破坏自然资源。</div>\r\n\r\n<div class=\"para\"><strong>第十条</strong>　城市的土地属于国家所有。</div>\r\n\r\n<div class=\"para\">农村和<a href=\"/view/809222.htm\" target=\"_blank\">城市郊区</a>的土地，除由法律规定属于国家所有的以外，属于集体所有；宅基地和自留地、自留山，也属于集体所有。</div>\r\n\r\n<div class=\"para\">国家为了公共利益的需要，可以依照法律规定对土地实行征收或者征用并给予补偿。</div>\r\n\r\n<div class=\"para\">任何组织或者个人不得侵占、买卖或者以其他形式<a href=\"/view/2848469.htm\" target=\"_blank\">非法转让土地</a>。土地的使用权可以依照法律的规定转让。</div>\r\n\r\n<div class=\"para\">一切使用土地的组织和个人必须合理地利用土地。</div>\r\n\r\n<div class=\"para\"><strong>第十一条　</strong>在法律规定范围内的个体经济、私营经济等<a href=\"/view/176305.htm\" target=\"_blank\">非公有制经济</a>，是社会主义市场经济的重要组成部分。</div>\r\n\r\n<div class=\"para\">国家保护个体经济、私营经济等非<a href=\"/view/187220.htm\" target=\"_blank\">公有制</a>经济的合法的权利和利益。国家鼓励、支持和引导非公有制经济的发展，并对非公有制经济依法实行监督和管理。</div>\r\n\r\n<div class=\"para\"><strong>第十二条</strong>　社会主义的<a href=\"/view/3486276.htm\" target=\"_blank\">公共财产</a>神圣不可侵犯。</div>\r\n\r\n<div class=\"para\">国家保护社会主义的公共<a href=\"/view/308753.htm\" target=\"_blank\">财产</a>。禁止任何组织或者个人用任何手段侵占或者破坏国家的和集体的财产。</div>\r\n\r\n<div class=\"para\"><strong>第十三条　</strong>公民的合法的<a href=\"/view/857760.htm\" target=\"_blank\">私有财产</a>不受侵犯。</div>\r\n\r\n<div class=\"para\">国家依照法律规定保护公民的私有<a href=\"/view/22801.htm\" target=\"_blank\">财产权</a>和继承权。</div>\r\n\r\n<div class=\"para\">国家为了公共利益的需要，可以依照法律规定对公民的私有财产实行征收或者征用并给予补偿。</div>\r\n\r\n<div class=\"para\"><strong>第十四条</strong>　国家通过提高劳动者的积极性和技术水平，推广先进的科学技术，完善<a href=\"/view/899956.htm\" target=\"_blank\">经济管理体制</a>和企业经营<a href=\"/view/673434.htm\" target=\"_blank\">管理制度</a>，实行各种形式的社会主义责任制，改进<a href=\"/view/3026895.htm\" target=\"_blank\">劳动组织</a>，以不断提高劳动生产率和经济效益，发展社会<a href=\"/view/4844.htm\" target=\"_blank\">生产力</a>。</div>\r\n\r\n<div class=\"para\">国家厉行节约，反对浪费。</div>\r\n\r\n<div class=\"para\">国家合理安排积累和消费，兼顾国家、集体和个人的利益，在发展生产的基础上，逐步改善人民的物质生活和文化生活。</div>\r\n\r\n<div class=\"para\">国家建立健全同经济发展水平相适应的<a href=\"/view/101434.htm\" target=\"_blank\">社会保障</a>制度。</div>\r\n\r\n<div class=\"para\"><strong>第十五条</strong>　国家实行<a href=\"/view/31553.htm\" target=\"_blank\">社会主义市场经济</a>。</div>\r\n\r\n<div class=\"para\">国家加强经济立法，完善<a href=\"/view/16822.htm\" target=\"_blank\">宏观调控</a>。</div>\r\n\r\n<div class=\"para\">国家依法禁止任何组织或者个人扰乱社会经济秩序。</div>\r\n\r\n<div class=\"para\"><strong>第十六条</strong>　国有企业在法律规定的范围内有权自主经营。</div>\r\n\r\n<div class=\"para\">国有企业依照法律规定，通过<a href=\"/view/436363.htm\" target=\"_blank\">职工代表大会</a>和其他形式，实行<a href=\"/view/666355.htm\" target=\"_blank\">民主管理</a>。</div>\r\n\r\n<div class=\"para\"><strong>第十七条</strong>　集体经济组织在遵守有关法律的前提下，有独立进行<a href=\"/view/1458211.htm\" target=\"_blank\">经济活动</a>的自主权。</div>\r\n\r\n<div class=\"para\">集体经济组织实行<a href=\"/view/666355.htm\" target=\"_blank\">民主管理</a>，依照法律规定选举和罢免管理人员，决定经营管理的重大问题。</div>\r\n\r\n<div class=\"para\"><strong>第十八条</strong>　中华人民共和国允许外国的企业和<a href=\"/view/2947202.htm\" target=\"_blank\">其他经济组织</a>或者个人依照<a href=\"/view/7864737.htm\" target=\"_blank\">中华人民共和国法律</a>的规定在<a href=\"/view/2092632.htm\" target=\"_blank\">中国投资</a>，同中国的企业或者其他经济组织进行各种形式的经济合作。</div>\r\n\r\n<div class=\"para\">在中国境内的<a href=\"/view/2171632.htm\" target=\"_blank\">外国企业</a>和其他外国经济组织以及中外合资经营的企业，都必须遵守中华人民共和国的法律。它们的合法的权利和利益受中华人民共和国法律的保护。</div>\r\n\r\n<div class=\"para\"><strong>第十九条</strong>　国家发展社会主义的教育事业，提高全国人民的科学文化水平。</div>\r\n\r\n<div class=\"para\">国家举办各种学校，普及初等<a href=\"/view/29450.htm\" target=\"_blank\">义务教育</a>，发展<a href=\"/view/119023.htm\" target=\"_blank\">中等教育</a>、<a href=\"/view/105491.htm\" target=\"_blank\">职业教育</a>和<a href=\"/view/11005.htm\" target=\"_blank\">高等教育</a>，并且发展<a href=\"/view/86251.htm\" target=\"_blank\">学前教育</a>。</div>\r\n\r\n<div class=\"para\">国家发展各种教育设施，扫除<a href=\"/view/365864.htm\" target=\"_blank\">文盲</a>，对工人、农民、国家工作人员和其他劳动者进行政治、文化、科学、技术、业务的教育，鼓励<a href=\"/view/1009190.htm\" target=\"_blank\">自学成才</a>。</div>\r\n\r\n<div class=\"para\">国家鼓励集体经济组织、国家企业事业组织和其他社会力量依照法律规定举办各种教育事业。</div>\r\n\r\n<div class=\"para\">国家推广全国通用的<a href=\"/view/4591.htm\" target=\"_blank\">普通话</a>。</div>\r\n\r\n<div class=\"para\"><strong>第二十条　</strong>国家发展自然科学和社会科学事业，普及科学和技术知识，奖励<a href=\"/view/222266.htm\" target=\"_blank\">科学研究成果</a>和技术发明创造。</div>\r\n\r\n<div class=\"para\"><strong>第二十一条</strong>　国家发展医疗卫生事业，发展现代医药和我国传统医药，鼓励和支持农村集体经济组织、国家企业事业组织和街道组织举办各种医疗卫生设施，开展群众性的卫生活动，保护人民健康。</div>\r\n\r\n<div class=\"para\">国家发展<a href=\"/view/2231536.htm\" target=\"_blank\">体育事业</a>，开展群众性的体育活动，增强人民<a href=\"/view/131397.htm\" target=\"_blank\">体质</a>。</div>\r\n\r\n<div class=\"para\"><strong>第二十二条</strong>　国家发展为人民服务、为社会主义服务的文学艺术事业、新闻<a href=\"/view/425071.htm\" target=\"_blank\">广播电视</a>事业、出版发行事业、图书馆博物馆文化馆和其他文化事业，开展群众性的文化活动。</div>\r\n\r\n<div class=\"para\">国家保护<a href=\"/view/72143.htm\" target=\"_blank\">名胜古迹</a>、珍贵文物和其他重要历史文化遗产。</div>\r\n\r\n<div class=\"para\"><strong>第二十三条</strong>　国家培养为社会主义服务的各种专业人才，扩大知识分子的队伍，创造条件，充分发挥他们在社会主义现代化建设中的作用。</div>\r\n\r\n<div class=\"para\"><strong>第二十四条</strong>　国家通过普及理想教育、道德教育、文化教育、<a href=\"/view/257495.htm\" target=\"_blank\">纪律</a>和法制教育，通过在城乡不同范围的群众中制定和执行各种守则、公约，加强<a href=\"/view/618237.htm\" target=\"_blank\">社会主义精神文明</a>的建设。</div>\r\n\r\n<div class=\"para\">国家提倡爱祖国、爱人民、爱劳动、爱科学、爱社会主义的公德，在人民中进行<a href=\"/view/10087.htm\" target=\"_blank\">爱国主义</a>、集体主义和国际主义、<a href=\"/view/4304.htm\" target=\"_blank\">共产主义</a>的教育，进行<a href=\"/view/14127.htm\" target=\"_blank\">辩证唯物主义</a>和历史唯物主义的教育，<a href=\"/view/2026812.htm\" target=\"_blank\">反对资本主义</a>的、封建主义的和其他的腐朽思想。</div>\r\n\r\n<div class=\"para\"><strong>第二十五条</strong>　国家推行<a href=\"/view/32644.htm\" target=\"_blank\">计划生育</a>，使人口的增长同经济和<a href=\"/view/391473.htm\" target=\"_blank\">社会发展</a>计划相适应。</div>\r\n\r\n<div class=\"para\"><strong>第二十六条　</strong>国家保护和改善生活环境和生态环境，防治污染和其他<a href=\"/view/244249.htm\" target=\"_blank\">公害</a>。</div>\r\n\r\n<div class=\"para\">国家组织和鼓励植树造林，保护林木。</div>\r\n\r\n<div class=\"para\"><strong>第二十七条</strong>　一切<a href=\"/view/652695.htm\" target=\"_blank\">国家机关</a>实行精简的原则，实行工作责任制，实行工作人员的培训和考核制度，不断提高工作质量和工作效率，反对官僚主义。</div>\r\n\r\n<div class=\"para\">一切国家机关和国家工作人员必须依靠人民的支持，经常保持同人民的密切联系，倾听人民的意见和建议，接受人民的监督，努力为人民服务。</div>\r\n\r\n<div class=\"para\"><strong>第二十八条</strong>　国家维护社会秩序，镇压叛国和其他危害国家安全的犯罪活动，制裁危害社会治安、破坏<a href=\"/view/2108071.htm\" target=\"_blank\">社会主义经济</a>和其他犯罪的活动，惩办和改造犯罪分子。</div>\r\n\r\n<div class=\"para\"><strong>第二十九条</strong>　中华人民共和国的武装力量属于人民。它的任务是巩固国防，抵抗侵略，保卫祖国，保卫人民的和平劳动，参加国家建设事业，努力为人民服务。</div>\r\n\r\n<div class=\"para\">国家加强武装力量的革命化、现代化、正规化的建设，增强国防力量。</div>\r\n\r\n<div class=\"para\"><strong>第三十条　</strong>中华人民共和国的<a href=\"/view/593053.htm\" target=\"_blank\">行政区域</a>划分如下：</div>\r\n\r\n<div class=\"para\">（一）全国分为<a href=\"/view/175009.htm\" target=\"_blank\">省</a>、<a href=\"/view/54334.htm\" target=\"_blank\">自治区</a>、<a href=\"/view/39377.htm\" target=\"_blank\">直辖市</a>；</div>\r\n\r\n<div class=\"para\">（二）省、自治区分为<a href=\"/view/94790.htm\" target=\"_blank\">自治州</a>、<a href=\"/view/91954.htm\" target=\"_blank\">县</a>、<a href=\"/view/91980.htm\" target=\"_blank\">自治县</a>、<a href=\"/view/175012.htm\" target=\"_blank\">市</a>；</div>\r\n\r\n<div class=\"para\">（三）县、自治县分为<a href=\"/view/175014.htm\" target=\"_blank\">乡</a>、<a href=\"/view/257298.htm\" target=\"_blank\">民族乡</a>、<a href=\"/view/135976.htm\" target=\"_blank\">镇</a>。</div>\r\n\r\n<div class=\"para\">直辖市和<a href=\"/view/680793.htm\" target=\"_blank\">较大的市</a>分为区、县。自治州分为县、自治县、市。</div>\r\n\r\n<div class=\"para\">自治区、自治州、自治县都是民族自治地方。</div>\r\n\r\n<div class=\"para\"><strong>第三十一条</strong>　国家在必要时得设立<a href=\"/view/133642.htm\" target=\"_blank\">特别行政区</a>。在特别行政区内实行的制度按照具体情况由全国人民代表大会以法律规定。</div>\r\n\r\n<div class=\"para\"><strong>第三十二条</strong>　中华人民共和国保护在中国境内的<a href=\"/view/775403.htm\" target=\"_blank\">外国人</a>的合法权利和利益，在中国境内的外国人必须遵守中华人民共和国的法律。</div>\r\n\r\n<div class=\"para\">中华人民共和国对于因为政治原因要求避难的外国人，可以给予受庇护的权利。</div>\r\n</div>\r\n\r\n<div class=\"para\">&nbsp;</div>\r\n\r\n<div class=\"para\">&nbsp;</div>\r\n\r\n<div class=\"para\">&nbsp;</div>\r\n\r\n<div class=\"para\">&nbsp;</div>');
