  `tp_createtime` datetime NOT NULL COMMENT '创建时间',
  `tp_publishtime` datetime DEFAULT NULL COMMENT '发布时间   控制投票谁可以看到',
  `stuts` tinyint(4) DEFAULT '0' COMMENT '状态  0 未发布 1生效   2终止         新建投票默认0未发布',
  PRIMARY KEY (`id`)
